import React from "react";
import Link from "next/link";

export const HeaderAnchor = (props) => {
  return (
    <Link as={props.to}>
      <a className='header-btn'>{props.title}</a>
      <style jsx>
        {`
          .header-btn {
            height: 100%;
            width: 300px;
            background: none;
            outline: none;
            font-weight: 500;
            font-size: 1.2rem;
            color: white;
          }
        `}
      </style>
    </Link>
  );
};
